import axios from "axios";

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL;

export const login = async (userId, credentials) => {
  const response = await axios.post(`${API_BASE_URL}/auth/login`, {
    user_id: userId,
    credentials,
  });
  return response.data;
};
